from Scraping_shoops.Foxtrot.shop_model import FoxtrotStorefrom databases.parse_db import get_info_from_dbdef start_foxtrot():    foxtrot = FoxtrotStore()    items = foxtrot.generate_info(all_items=foxtrot.all_items)    compare_data(items)    print(f'{FoxtrotStore.__name__} OK')def compare_data(partner_list):    items_from_db = list(get_info_from_db())    items_dict = {item.article: item for item in items_from_db}    missing_items = []    for elem in partner_list:        article = elem['article']        price_partner = int(elem['price'])        if article in items_dict:            item = items_dict[article]            item_price = int(item.price.decode('utf-8')) if isinstance(item.price, bytes) else int(item.price)            if price_partner == item_price:                print(f'{article} - {price_partner} грн - OK')            else:                print(f'{article}, partner price = {price_partner} грн, RRP price = {item_price} грн')        else:            missing_items.append(article)            print(f'Article {article} not found in the database')    return missing_items